def my_func(input1: str):
    if len(input1) < 1 or len(input1) > 20:
        return ""
    tokens = input1.split()
    result = []
    for token in tokens:
        parts = token.split('-')
        for i in range(1, len(parts)):
            parts[i] = parts[i].capitalize()
        result.append(''.join(parts))
    return ' '.join(result)
